--
-- Table structure for table `organization`
--

DROP TABLE IF EXISTS `organization`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `organization` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT '机构名',
  `otype` tinyint(4) NOT NULL COMMENT '机构类型，1中介机构2内审机构3机关机构',
  `deputy` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT '法人代表',
  `regtime` int(11) NOT NULL COMMENT '注册时间',
  `regnum` varchar(24) COLLATE utf8mb4_bin NOT NULL COMMENT '注册地点编号',
  `regaddress` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT '注册地址',
  `category` varchar(16) COLLATE utf8mb4_bin NOT NULL COMMENT '资质类别',
  `level` varchar(16) COLLATE utf8mb4_bin NOT NULL COMMENT '资质等级',
  `capital` int(11) NOT NULL COMMENT '注册资本',
  `workbegin` int(11) NOT NULL COMMENT '从业开始时间',
  `costeng` int(10) unsigned NOT NULL COMMENT '造价工程师人数',
  `coster` int(10) unsigned NOT NULL COMMENT '造价师人数',
  `accountant` int(10) unsigned NOT NULL COMMENT '会计师人数',
  `highlevel` int(10) unsigned NOT NULL COMMENT '高级职称人数',
  `midlevel` int(10) unsigned NOT NULL COMMENT '中级职称',
  `retiree` varchar(100) COLLATE utf8mb4_bin NOT NULL COMMENT '退休人员',
  `parttimers` varchar(100) COLLATE utf8mb4_bin NOT NULL COMMENT '兼职人员',
  `contactor` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT '联系人',
  `contactphone` char(11) COLLATE utf8mb4_bin NOT NULL COMMENT '联系人电话',
  `contactnumber` varchar(11) COLLATE utf8mb4_bin NOT NULL COMMENT '联系电话',
  `officenum` varchar(24) COLLATE utf8mb4_bin NOT NULL COMMENT '办公地点编号',
  `officeaddress` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT '办公地址',
  `ctime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `utime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `qualiaudit` tinyint(4) NOT NULL DEFAULT '2',
  `parentid` int(10) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `index_otype` (`otype`)
) ENGINE=InnoDB AUTO_INCREMENT=1243 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='机构';
/*!40101 SET character_set_client = @saved_cs_client */;

