DROP TABLE IF EXISTS `people`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `people` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `pid` varchar(64) COLLATE utf8mb4_bin NOT NULL COMMENT '员工id',
  `name` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT '姓名',
  `sex` tinyint(4) NOT NULL COMMENT '性别，1男2女',
  `type` tinyint(4) NOT NULL COMMENT '人员类别 1 审计机关 2 内审机构 3 中介机构',
  `organid` int(10) unsigned NOT NULL COMMENT '机构，与机构关联',
