DROP TABLE IF EXISTS `project`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `project` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `status` tinyint(4) NOT NULL COMMENT '项目阶段 1计划阶段 2实施阶段 3审理阶段 4报告阶段 5项目结束',
  `projectnum` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT '项目编号',
  `name` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT '项目名',
  `projyear` int(10) NOT NULL COMMENT '项目年度',
  `plantime` int(10) unsigned NOT NULL COMMENT '计划时长',
  `projdesc` varchar(500) COLLATE utf8mb4_bin NOT NULL COMMENT '项目描述',
  `projorgan` int(10) NOT NULL COMMENT '项目单位，与机构关联，且必须是审计机关',
  `projtype` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT '项目类型，类型表存config中',
  `projlevel` tinyint(4) NOT NULL COMMENT '项目层级 1省厅统一组织 2市州本级 3市州统一组织 4县级',
  `leadorgan` int(10) DEFAULT NULL COMMENT '牵头业务单位，与组织关联，且必须与projlevel匹配',
  `projstart` date NOT NULL COMMENT '项目开始时间',
  `projauditcontent` varchar(500) COLLATE utf8mb4_bin NOT NULL COMMENT '审计内容',
  `leadernum` int(10) NOT NULL COMMENT '审计组长人数',
  `auditornum` int(10) NOT NULL COMMENT '审计人员人数',
  `masternum` int(10) NOT NULL COMMENT '主审人数',
  `ctime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `utime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `jugenum` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '审理人数',
  PRIMARY KEY (`id`),
  UNIQUE KEY `projectnum` (`projectnum`)
) ENGINE=InnoDB AUTO_INCREMENT=100 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='项目表';
